import React from "react";
import { UserIcon } from '@heroicons/react/24/outline';

const learnLanguages = [
    "Norsk",
    "Francais",
    "Italiano"
];

const useLanguages = [
    "English"
];

function Login() {
    return(
    <UserIcon className="absolute top-6 right-8 h-10 w-10 text-gray-600 cursor-pointer" />
    );
}

function DropDown(props) {
    return (
        <div>
        <h1>{props.label}</h1>
        <select className = "cursor-pointer">
        {props.list.map((opt) => {
            return(
                <option key={opt}>{opt}</option>
            ) 
        })}
        </select>
        </div>
    );
}
 
const Home = () => {
    return (
        <div bg-red-200 flex flex-col justify-center items-center h-screen>
            <Login />
            <div className ="space-y-4">
            <DropDown label="Learn" list={learnLanguages} />
            <DropDown label="Using" list = {useLanguages} />
            <button className = "bg-red-300">Launch Chatroom</button>
            </div>
        </div>
    );
};
 
export default Home;
